ull,"decimals":null,"definition":"Esri 2028 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in total Households between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSFAMGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Families","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Families: Compound Annual Growth Rate (CAGR). The Families CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of families between the years 2023 and 2028. A family consists of two or more people residing together that are related by birth, marriage, or adoption. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HISTORICALHOUSEHOLDSTSHH20CY":{"type":"number","alias":"2020 Households (Esri 2023)","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Time Series: retroactive estimate of the Total Number of Households on July 1, 2020. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more inform  in the geographic area. The Average Household Size is calculated by dividing the number of persons living in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY":{"id":"POPGRWCYFY","fullName":"KeyUSFacts.POPGRWCYFY","alias":"2023-2028 Growth Rate: Population","fieldName":"KEYUSFACTSPOPGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY":{"id":"HHGRWCYFY","fullName":"KeyUSFacts.HHGRWCYFY","alias":"2023-2028 Growth Rate: Households","fieldName":"KEYUSFACTSHHGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure
